import React from "react";

import styled from "styled-components";

import Footer from "./Footer";

const Contact = () => {
  return (
    <>
      <Wrapper>
        <h1>Contact
          
        </h1>
        <Footer />
      </Wrapper>
    </>
  );
};

export default Contact;

const Wrapper = styled.div`
  font-size: 55px;
  color: white;
`;
